            UPDATE sinh_vien
            SET ma_chuyen_nganh = current_value
            WHERE ma_chuyen_nganh IS NULL
            LIMIT 1;
        ELSE
            -- Nếu hết mã, giữ nguyên giá trị như cũ
            UPDATE sinh_vien
            SET ma_chuyen_nganh = ma_chuyen_nganh
            WHERE ma_chuyen_nganh IS NULL;
        END IF;
