CREATE TRIGGER `calculate_bang_diem_hk` AFTER INSERT ON `chi_tiet_diem_hk` FOR EACH ROW BEGIN
    DECLARE tin_chi INT DEFAULT 0;
    DECLARE diem_tong DECIMAL(10,2) DEFAULT 0.00;
    DECLARE diem_10_tk DECIMAL(4,2) DEFAULT 0.00;
    DECLARE gpa_10 DECIMAL(3,1) DEFAULT 0.00;
    DECLARE total_tin_chi INT DEFAULT 0;
    DECLARE gpa_4 DECIMAL(3,1) DEFAULT 0.00;

    -- Tính tổng điểm (diem_10_tk * tin_chi) cho từng môn học của sinh viên trong học kỳ
    SELECT SUM(ct.diem_10_TK * m.tin_chi), SUM(m.tin_chi)
    INTO diem_tong, total_tin_chi
    FROM chi_tiet_diem_hk ct
    JOIN mon_hoc m ON ct.ma_mon = m.ma_mon_hoc
    WHERE ct.ma_sv = NEW.ma_sv
    AND ct.ma_hk = NEW.ma_hk;
    
    -- Tính GPA 10
    IF total_tin_chi > 0 THEN
        SET gpa_10 = ROUND(diem_tong / total_tin_chi, 2);
    ELSE
        SET gpa_10 = 0.00;
    END IF;

    -- Tính GPA 4
    IF gpa_10 >= 9 THEN
        SET gpa_4 = 4.0;
    ELSEIF gpa_10 >= 8 THEN
        SET gpa_4 = 3.5;
    ELSEIF gpa_10 >= 7 THEN
        SET gpa_4 = 3.0;
    ELSEIF gpa_10 >= 6 THEN
        SET gpa_4 = 2.5;
    ELSEIF gpa_10 >= 5 THEN
        SET gpa_4 = 2.0;
    ELSEIF gpa_10 >= 4 THEN
        SET gpa_4 = 1.5;
    ELSE
        SET gpa_4 = 1.0;
    END IF;

    -- Cập nhật bảng bang_diem_hoc_ky với tổng tín chỉ, GPA và GPA 4
    UPDATE bang_diem_hoc_ky
    SET tin_chi_hoc_ky = total_tin_chi,         -- Cập nhật tổng tín chỉ học kỳ
        gpa_10_hoc_ky = gpa_10,                 -- Cập nhật GPA 10
        gpa_4_hoc_ky = gpa_4                    -- Cập nhật GPA 4
    WHERE ma_sv = NEW.ma_sv
    AND ma_hoc_ky = NEW.ma_hk
    AND ma_bang_diem_hoc_ky = NEW.ma_bang_diem_hk;
    
END//
DELIMITER ;
