DELIMITER //
CREATE TRIGGER `calculate_diem_hk` BEFORE INSERT ON `chi_tiet_diem_hk` FOR EACH ROW BEGIN
    DECLARE he_so_BT DECIMAL(3,2);
    DECLARE he_so_BTL DECIMAL(3,2);
    DECLARE he_so_TN DECIMAL(3,2);
    DECLARE he_so_GK DECIMAL(3,2);
    DECLARE he_so_CK DECIMAL(3,2);
    DECLARE diem_tong DECIMAL(3,1) DEFAULT 0.00;
    DECLARE error_message VARCHAR(255);

    -- Lấy hệ số từ bảng mon_hoc
    SELECT m.he_so_BT, m.he_so_BTL, m.he_so_TN, m.he_so_GK, m.he_so_CK
    INTO he_so_BT, he_so_BTL, he_so_TN, he_so_GK, he_so_CK
    FROM mon_hoc m
    WHERE ma_mon_hoc = NEW.ma_mon;

    -- Đảm bảo các hệ số được lấy hợp lệ
    IF he_so_BT IS NULL OR he_so_BTL IS NULL OR he_so_TN IS NULL OR he_so_GK IS NULL OR he_so_CK IS NULL THEN
        SET error_message = 'Hệ số không hợp lệ cho môn học';
    END IF;

    -- Tính điểm tổng kết hệ 10
    SET diem_tong = (NEW.diem_BT * he_so_BT) +
                    (NEW.diem_BTL * he_so_BTL) +
                    (NEW.diem_TN * he_so_TN) +
                    (NEW.diem_GK * he_so_GK) +
                    (NEW.diem_CK * he_so_CK);

    -- Gán giá trị tính toán vào dòng mới
    SET NEW.diem_10_TK = diem_tong;
    
    -- Quy đổi điểm hệ 4
    CASE
        WHEN diem_tong >= 8.5 THEN SET NEW.diem_4_TK = 4.0;
        WHEN diem_tong >= 8.0 THEN SET NEW.diem_4_TK = 3.5;
        WHEN diem_tong >= 7.0 THEN SET NEW.diem_4_TK = 3.0;
        WHEN diem_tong >= 6.5 THEN SET NEW.diem_4_TK = 2.5;
        WHEN diem_tong >= 5.5 THEN SET NEW.diem_4_TK = 2.0;
        WHEN diem_tong >= 5.0 THEN SET NEW.diem_4_TK = 1.5;
        WHEN diem_tong >= 4.0 THEN SET NEW.diem_4_TK = 1.0;
        ELSE SET NEW.diem_4_TK = 0.0;
    END CASE;

    -- Quy đổi điểm chữ
    CASE
        WHEN diem_tong >= 8.5 THEN SET NEW.diem_chu_TK = 'A';
        WHEN diem_tong >= 8.0 THEN SET NEW.diem_chu_TK = 'B+';
		  WHEN diem_tong >= 7.0 THEN SET NEW.diem_chu_TK = 'B';
        WHEN diem_tong >= 6.5 THEN SET NEW.diem_chu_TK = 'C+';
        WHEN diem_tong >= 5.5 THEN SET NEW.diem_chu_TK = 'C';
        WHEN diem_tong >= 5.0 THEN SET NEW.diem_chu_TK = 'D+';
        WHEN diem_tong >= 4.0 THEN SET NEW.diem_chu_TK = 'D';
        ELSE SET NEW.diem_chu_TK = 'F';
    END CASE;

END//
DELIMITER ;
