CREATE TRIGGER check_time_overlap
BEFORE INSERT ON lich_lop_hoc
FOR EACH ROW
BEGIN
    DECLARE conflict_count INT;

    -- Kiểm tra xung đột về thời gian
    SELECT COUNT(*)
    INTO conflict_count
    FROM lich_lop_hoc
    WHERE ma_dia_diem = NEW.ma_dia_diem
      AND nam = NEW.nam
      AND tuan = NEW.tuan
      AND ngay = NEW.ngay
      AND (
          (NEW.tiet_bat_dau BETWEEN tiet_bat_dau AND tiet_ket_thuc) OR
          (NEW.tiet_ket_thuc BETWEEN tiet_bat_dau AND tiet_ket_thuc) OR
          (tiet_bat_dau BETWEEN NEW.tiet_bat_dau AND NEW.tiet_ket_thuc) OR
          (tiet_ket_thuc BETWEEN NEW.tiet_bat_dau AND NEW.tiet_ket_thuc)
      );
    IF conflict_count > 0 THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Conflict detected: Time slots overlap for the same room, date, and time.';
    END IF;
END//
